CREATE TABLE IF NOT EXISTS jadwal_mata_pelajaran(
   no                   INTEGER  NOT NULL PRIMARY KEY 
  ,kelas                VARCHAR(3) NOT NULL
  ,hari                 VARCHAR(6) NOT NULL
  ,waktu                VARCHAR(13) NOT NULL
  ,matematika           BIT  NOT NULL
  ,bahasa_indonesia     BIT  NOT NULL
  ,bahasa_inggris       BIT  NOT NULL
  ,pendidikan_pancasila BIT  NOT NULL
  ,fisika               BIT  NOT NULL
  ,kimia                BIT  NOT NULL
  ,biologi              BIT  NOT NULL
  ,ips                  BIT  NOT NULL
  ,seni_budaya          BIT  NOT NULL
  ,informatika          BIT  NOT NULL
  ,agama                BIT  NOT NULL
  ,pjok                 BIT  NOT NULL
  ,keterampilan_pilihan BIT  NOT NULL
);
